    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro14f9d",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0115016 includes chemical,
    discrete sample, physical and profile data collected from KAIYO-MARU in the North
    Pacific Ocean and Philippine Sea from 1996-06-17 to 1996-07-02 and retrieved during
    cruise WOCE_P08S. These data include ALKALINITY, DELTA CARBON-14, DISSOLVED INORGANIC
    CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
    Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen isotope), WATER
    TEMPERATURE and pH. The instruments used to collect these data include CTD and bottle.
    These data were collected by Noriya Yoshioka of Japan Marine Science and Technology
    Center as part of the WOCE_P08S data set.nnThe World Ocean Circulation Experiment
    (WOCE) was a major component of the World Climate Research Program with the overall
    goal of better understanding the ocean's role in climate and climatic changes resulting
    from both natural and anthropogenic causes. The CO2 survey took advantage of the
    sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
